import React from 'react';
import { SimpleGrid, Heading, Image } from "@chakra-ui/react";

const WashingtonDC = () => {
  return (
    <div>

      <Heading
      size = 'xl'
      position = 'relative'
      fontFamily = 'monospace'
      top = '0px'>
        Washington DC
      </Heading>

      <SimpleGrid columns={2} spacing="40px">



      </SimpleGrid>

    </div>
  )
};

export default WashingtonDC;
